import React from 'react';
import Nav from './Nav';
import Footer from './Footer';
import Lobby from './Lobby';
import Api from './Api';
import Link from './Link';
import Router from './Router';
import './App.css';

function App() {
  return (
    <div className="App container-fluid ml-lg-4">
      <Router/>
      <Api route='/connexion'/>
      <Link to='/connexion'/>
      <Nav/>
      <Lobby/>
      <Footer/>
    </div>
  );
}

export default App;
